import { createStore } from "redux";

const initialState: any = {
	user: {
		name: "",
	},
	restaurant: {},
};
function counterReducer(state = initialState, action: any) {
	switch (action.type) {
		default:
			return state;
	}
}

const store = createStore(counterReducer);
export default store;
